    false,nt"url": null,nt"notes": "This annual narrative report for Lake Zahl
    National Wildlife Refuge outlines Refuge accomplishments during the 1978 calendar
    year. The report begins by describing the climate and habitat conditions in the
    Refuge, as well as the land acquisition program, and system status. The habitat
    management section discusses croplands, grasslands, and wetlands. Wildlife- including
    endangered and threatened species, migratory birds, big game animals, and raptors-
    are discussed. The public relations sections describes information and recreation.
